import React from "react";
import Link from "next/link";
const PostTagItems = props => (
  <Link href="/">
    <a
      style={{
        textDecorationLine: "none",
        fontSize: "18px",
        padding: '5px',
        borderRadius: '5px',
        margin: "5px",
        backgroundColor: props.color
      }}
    >
      {props.tag}
    </a>
  </Link>
);

export default PostTagItems;
